function genRotations($s) {
    $result = [];
    for ($i = 1; $i < strlen($s); $i++) {
        array_push($result, substr($s, $i) . substr($s, 0, $i));
    }
    return $result;
}

function sumOfRotations($s) {
    $result = 0;
    foreach (genRotations($s) as $r) {
        $result += intval($r);
    }
    return $result;
}
